import base64
import math

s1 = ''

s2 = ''

d1 = base64.b64decode(s1)
d2 = base64.b64decode(s2)

def entropy(data):
    if not data:
        return 0
    entropy = 0
    for x in range(256):
        p_x = float(data.count(bytes([x]))) / len(data)
        if p_x > 0:
            entropy += - p_x * math.log2(p_x)
    return entropy

print("=" * 60)
print("ANALYSIS OF BASE64-ENCODED STRINGS")
print("=" * 60)
print(f"\nString 1 length: {len(d1)} bytes")
print(f"String 2 length: {len(d2)} bytes")
print(f"\nString 1 entropy: {entropy(d1):.2f} bits/byte (max is 8.0)")
print(f"String 2 entropy: {entropy(d2):.2f} bits/byte (max is 8.0)")
print("\nHigh entropy (>7.0) typically indicates encrypted/compressed data")

print(f"\n{'='*60}")
print("BYTE-BY-BYTE COMPARISON")
print("=" * 60)
print(f"\nFirst 32 bytes (identical in both):")
print(f"Hex: {d1[:32].hex()}")
print(f"ASCII (if printable): {repr(d1[:32])}")

# Find where they differ
diff_pos = None
for i in range(min(len(d1), len(d2))):
    if d1[i] != d2[i]:
        diff_pos = i
        break

if diff_pos:
    print(f"\nStrings differ starting at byte position: {diff_pos}")
    print(f"\nString 1 bytes {diff_pos}-{diff_pos+20}:")
    print(f"  Hex: {d1[diff_pos:diff_pos+20].hex()}")
    print(f"  Repr: {repr(d1[diff_pos:diff_pos+20])}")
    print(f"\nString 2 bytes {diff_pos}-{diff_pos+20}:")
    print(f"  Hex: {d2[diff_pos:diff_pos+20].hex()}")
    print(f"  Repr: {repr(d2[diff_pos:diff_pos+20])}")

# Check if rest is identical
if diff_pos:
    rest_same = d1[diff_pos+20:] == d2[diff_pos+20:]
    print(f"\nRemaining bytes after position {diff_pos+20} are identical: {rest_same}")

print(f"\n{'='*60}")
print("LIKELY FORMAT ANALYSIS")
print("=" * 60)
print("\nBased on the analysis:")
print("1. High entropy suggests encrypted or compressed data")
print("2. Same prefix (32 bytes) suggests same header/metadata")
print("3. Different middle section suggests different payload/IV/nonce")
print("4. Same suffix suggests same signature or footer")
print("\nThis pattern is typical of:")
print("- Encrypted data with different initialization vectors (IVs)")
print("- Signed/encrypted tokens with different payloads")
print("- Encrypted data with different nonces but same structure")

